import React from "react";
import "./expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "./Card";

function Expenses(items) {
  return (
    <Card className="expenses">
      {items.map((item) => (
        <ExpenseItem
          title={items.title}
          amount={item.amount}
          date={items.date}
        />
      ))}
    </Card>
  );
}

export default Expenses;
